import React from 'react';
import TopNavbar from './components_man1/TopNavbar';
import MarketSummary from './components_man1/MarketSummary';
import StockChart from './components_man1/StockChart';
import OrderForm from './components_man1/OrderForm';
import OrderBookTabs from './components_man1/OrderBookTabs';
import Bieudo from './components_man1/Bieudo';
import Footer from './components_man1/Footer';
import './index.scss';
import './style/Fonts.module.scss';

function App() {
  return (
    <div className="app-container">
      <TopNavbar />
      <div className="MarketSummary">
        <MarketSummary />
      </div>
      <StockChart />
      <div className="main-content">
        <div className="left-column" >
          <Bieudo />
          <OrderBookTabs />
        </div>
        <div className="right-column">
          <OrderForm />
        </div>
      </div>
      <Footer />
    </div>
  );
}
export default App;
